import React from 'react';
import Post from './post.jsx'

const PostList = ({posts, title, remove}) => {

  if (!posts.length) {
    return (
      <div className='postEmpty'>Посты не найдены</div>
    )
  }
  return (
    <div>
      <h1 style={{textAlign: 'center', marginTop: '15px'}}>{title}</h1> 
      {
        posts.map((posts, index) => <Post remove = {remove} number= {index + 1} info = {posts} key = {posts.id}/>) 
      }
    </div>
  );
};

export default PostList;
